import { View, Text } from 'react-native';
import { Screens } from '../types'
import type { Id, Screen } from '../types';
import { NavigationProp } from '../types';


interface TodoDetailsScreenProps {
  id: Id
}

interface ScreenProps<T> extends NavigationProp {
  route: RouteProps<T>
}

interface RouteProps<T> {
  key: string,
  name: string,
  params: T
}

export const TodoDetailsScreen = (props: ScreenProps) => {
  console.log('=====')
  console.log(JSON.stringify(props))

  return (
    <>
    <View><Text>Todo Details Screen ({'props.params'})</Text></View>
    </>
  )
}

const screen: Screen = {
  name: Screens.TodoDetails,
  screen: TodoDetailsScreen
}

export default screen;
